package io.github.xenopyax.npc.util;

public enum Skin {
	TRAVELER_MALE("",
			"")
	,CITIZEN_MALE("",
			"")
	,BLACKSMITH_MALE("",
			"")
	,KNIGHT("",
			"")
	,PRINCESS("",
			"")
	,HUNTER_MALE("",
			"")
	,LUMBERJACK_MALE("",
			"")
	,MINER_MALE("",
			"")
	,MONK("",
		"")
	,PLAGUE_DOCTOR("",
			"")
	,FISHERMAN("",
			"");
	String texture, signature;
	
	Skin(String texture, String signature) {
		this.texture = texture;
		this.signature = signature;
	}
	
	public String getTexture() {
		return texture;
	}
	
	public String getSignature() {
		return signature;
	}
	
	public static Skin getByName(String name) {
		for(Skin skin : Skin.values()) {
			if(skin.name().equalsIgnoreCase(name)) {
				return skin;
			}
		}
		return null;
	}

}
